{{Location dec|50.759075|30.808617}}
Пам'ятка знаходиться на території державного заказника "Залісся", а простіше - мисливських угіддях президента, тому простим смертним туди вхід заборонений. По цій причині довелось лізти через паркан, і не бралась хороша фототехніка. Як потім виявилось, під час фотографування попав бруд на об'єктив і всі фотографії запоролись. Тому вдалось вирізати лише ці шматки. Хоча на них все дуже погано видно, але іншого не маємо :(
Можливо, журналісти зможуть отримати офіційно доступ туди і зробити якісні фотогрфії.


